<!DOCTYPE html>
<html>
<head>
    <link type="text/css" rel="stylesheet" href="https://cdn.jsdelivr.net/npm/swagger-ui-dist@4/swagger-ui.css">
    <link rel="shortcut icon" href="https://fastapi.tiangolo.com/img/favicon.png">
    <style>

    span.highlight {{background-color: #89bf04;
    border-radius: 32px;
    display: inline-block;
    padding: 3px;
    margin: 3px;
    }}

    </style>
    <title>HiQ UI</title>
</head>

<body _c_t_common="1" cz-shortcut-listen="true" _c_t_j1="1" data-new-gr-c-s-check-loaded="14.1085.0"
      data-gr-ext-installed="">
<div id="swagger-ui">
    <div class="swagger-ui">
        <div>
            <div class="information-container wrapper">
                <section class="block col-12">
                    <div>
                        <div class="info">
                            <hgroup class="main">
                                <h2 class="title">HiQ<span>
                                    <small><pre class="version"> v{hiq_version} </pre></small>
                                </h2>

                                <a href="/docs" rel="noopener noreferrer" class="link">
                                    <span class="url">API</span>
                                </a>
                                <br>
                                <span style="font-size:11px"> {basic_info}</span>
                            </hgroup>
                        </div>
                    </div>
                </section>
            </div>

            <div></div>
            <div class="wrapper">
                <section class="block col-12 block-desktop col-12-desktop">
                    <div>
                        <span>
                            <div class="opblock-tag-section">
                                <h3 class="opblock-tag no-desc" id="operations-tag-default">
                        <span>Latency</span></h3><noscript></noscript>
                            </div>
                        </span>
                        <div style="font-size:11px">
                            {latency}
                        </div>
                    </div>
                </section>
            </div>


        </div>
    </div>
</div>

</body>
</html>
